import "./App.css";
import logo from './Assets/Images/logo-falcone.jpg';

function App() {
  return (
    <>
      <navbar>
          <img src={logo} alt="logo" />
      </navbar>
      <section>
        <div className="hero-image hero-image--mountains">
          <div className="hero-title flex-center">
            Fly high <br /> as fuck!
          </div>
          <div></div>
        </div>
      </section>
      <section>2</section>
      <section>3</section>
      <section>4</section>
    </>
  );
}

export default App;
